    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 21 BETWEEN + col2 AND ( + col0 - + + col2 * col2 / - - 11 * + ( - 68 ) );
  - name: tab1

outputs:
  - name: q9253.out
    data: |
      51	14	96
      85	5	59
      91	47	68
